  @override
  String get settings_CreditsText => 'E drejta e autorit © 2021 MAWAQIT për Fondacionin MAWAQIT, të gjitha të drejtat e rezervuara.\n\nPronësia intelektuale dhe të drejtat e autorit të këtij aplikacioni ose shtojcave, shtesave ose përmbajtjes së tij janë në pronësi të MAWAQIT për shoqatën MAWAQIT.\n\nKy version është i licencuar vetëm për shpërndarje bamirësie dhe është një vakëf. Çdo përdorim komercial ose shpërndarje komerciale është rreptësisht i ndaluar.\n\nKjo licencë nuk tregon dhe nuk përfshin - në asnjë mënyrë - shitjen e ndonjë të drejte në lidhje me këtë produkt, ndonjë nga pjesët, shtojcat, shtesat ose përmbajtjen e tij. Përkundrazi, kjo licencë lejon vetëm shpërndarjen bamirëse të aplikacionit përmes platformës aktuale të dyqanit të aplikacioneve.\n\nRishpërndarja e aplikacionit duke përdorur kodin burimor ose skedarët binare, ose përdorimi i inxhinierisë së kundërt me ose pa bërë ndonjë ndryshim, do ta ekspozonte shkelësin ose atë që është përgjegjës për këtë shkelje të së drejtës së autorit ndaj veprimeve ligjore.\n\nAsnjë palë nuk ka të drejtë të rishpërndajë aplikacionin jashtë dyqaneve zyrtare të Apple ose Google Play pa një leje zyrtare me shkrim nga mbajtësi i së drejtës së autorit dhe pronari i aplikacionit, MAWAQIT për shoqatën MAWAQIT. Shpërndarja e këtij aplikacioni jashtë këtyre dyqaneve zyrtare do të ishte shkelje e ligjit për mbrojtjen e pronësisë intelektuale dhe do të ekspozonte përgjegjësit për këtë shkelje të së drejtës së autorit para veprimeve ligjore.\n\nNuk lejohet përdorimi i emrit ose markës së aplikacionit ose markës tregtare ose emrit të mbajtësit të së drejtës së autorit MAWAQIT për Fondacionin MAWAQIT për të promovuar produkte që janë të ngjashme ose që rrjedhin nga ky aplikacion ose ndonjë produkt tjetër pa marrë paraprakisht lejen me shkrim nga zotëruesi i së drejtës së autorit.\nKy aplikacion është i licencuar për t\'u shpërndarë nga mbajtësit e të drejtave të autorit dhe aksionarët \"siç është\".\n\nZhvilluesi dhe kompania pronare e aplikacionit nuk jep asnjë garanci të qartë ose të nënkuptuar, duke përfshirë - por pa u kufizuar në - reklamimin dhe promovimin për përshtatshmërinë e aplikacionit për një qëllim të caktuar. Në çdo rast, MAWAQIT për shoqatën MAWAQIT, ose aksionerët nuk janë përgjegjës për ndonjë dëm, të drejtpërdrejtë, të tërthortë ose aksidental (veçanërisht, paralajmërues, pasues), duke përfshirë - por pa u kufizuar në - humbjen e përdorimit, të dhënave ose fitimeve; ose ndërprerje biznesi, pavarësisht nga shkaqet dhe detyrimet, qofshin këto detyrime kontraktuale, absolute ose deliktore (përfshirë neglizhencën ose ndryshe) të cilat janë shkaktuar - në një mënyrë ose në një tjetër - nga përdorimi i këtij aplikacioni.\n\nTë drejtat e autorit të çdo pale të tretë në aplikacion i rezervohen mbajtësit të tyre.\n\nImazhet dhe sfondet\n\nE drejta e autorit shkon te Shutterstock\nIkonat — Licenca CC BY 4.0\n\nE drejta e autorit shkon te Flaticons\nLicenca MIT zbatohet për të gjithë skedarët pa font dhe pa ikona.\nFontet — Licenca SIL OFL 1.1\n\nE drejta e autorit shkon te fontet e Google (fontet Roboto)\nE drejta e autorit Apple, paketat Cupertino\nKodi, Paketat dhe Kornizat\n\nFlutter nga Google\nPaketat: http, geolocator, flutter_platform_widgets, shared_preferences, ofruesi, flutter_local_notifications, audioplayers, toggle_switch, cupertino_icons, marquee_widget, intl, flutter_switch, json_annotation';

  @override
  String get settings_AboutUsText => 'Ky aplikacion është zhvilluar nga shoqata MAWAQIT.\n\nShoqata MAWAQIT është një organizatë jofitimprurëse e krijuar në vitin 2021 në Francë.\nObjektivi ynë është zhvillimi i zgjidhjeve inovative në lidhje me IT dhe teknologjinë dixhitale si softuerët dhe faqet e internetit; mësim dhe trajnim në zgjidhjet dixhitale dhe mjetet e TI-së.\n\nEkosistemi MAWAQIT është produkti ynë kryesor dhe historia e tij filloi në vitin 2016, me një aplikacion në ekrane të mëdha kushtuar xhamive, më pas një aplikacion celular, një shtesë për ndihmës në shtëpi dhe një aftësi Alexa, etj.\n\nMAWAQIT ju ofron një mënyrë të re për të gjurmuar dhe menaxhuar kohët e namazit, në fakt ne ofrojmë një sistem nga fundi në fund që u ofron menaxherëve të xhamive një mjet në internet të disponueshëm 24/24 orë duke i lejuar ata të menaxhojnë oraret, lajmet e xhamisë dhe shumë veçori të tjera. Besimtarët, nga ana e tyre, përfitojnë nga një aplikacion celular i cili u lejon atyre të konsultojnë oraret e sakta dhe jo të përafërta të xhamisë së tyre të preferuar, si dhe lajmet dhe funksionalitetet e tjera si kërkimi i një xhamie sipas vendndodhjes gjeografike, ezanit, kibla. ... etj. Ne i kemi bërë vlerat tona kryesore besueshmërinë dhe cilësinë. Ambicia jonë është e qartë: të ndërtojmë shërbimin më të mirë për xhamitë tona falë teknologjisë dhe dizajnit.\n\nNëse ju pëlqeu ky aplikacion, ju lutemi jepni mendimin tuaj në dyqan.';

